2 Ozi, Pọlu jeru lẹ Tesalonáyika 1 Ụnwunna ayi; unubẹdua l'onwunu marua l'akpakfuta ono, ayi kpakfutajeru unu ono ta bụkwa kẹ mmakanụ. 2 Unu makwaru-a egbe iphe-ẹhuka, ayi jeeberu lẹ Fílipayi; makwaruphu ẹge e gude mee ayi iphe-iphere l'ẹke ono. Obenu lẹ Nchileke ayi melekwaru-a obu ayi; yo shihu ike; k'ọphu ayi byakwaduru bya ezia unu ozi-ọma Nchileke ono; ayi te dze lẹ ndu mkpọ-byi dọ-pheru ayi mgburumgburu. 3 Teke ono, ayi arọ unu t'unu bya abụru ndu kẹ Kuráyisutu ono bẹ iphe nọ ayi l'ọkpoma;
..........
i metaru iphe aa-ta ayi ụta. 11 Unu makọtaru l'ọo ẹge nna anọduje ehe ụnwu iya; bụ ẹge ayi shi ehe unu l'ẹhu l'ẹhu. 12 Ayi mewaru unu; obu eshihu unu ike. Ayi adụwa unu ike; kfuwa iya kfushiaru iya unu ike t'unu meje umere, dụ Nchileke mma. Ọo Nchileke ono bẹ kuru unu t'unu bya abata l'ẹke ya bụ eze; mẹkwaphu t'unu l'iya gbaru mgba nweru ọdu-biribiri nk'iya. 13 Iphe meru iphe ayi ta atugbejedu ẹka l'okele Nchileke ekele teke ayi ekfu anụ iya bụ lẹ teke unu nụru okfu Nchileke ono, ayi bya ezia un
